  return (
    <div className="grid-container">
    <header className="row">
       <div>
           <a className="brand" href="/">Amazona</a>
       </div>
       <div>
           <a href="/cart">Cart</a>
           <a href="/signin">Sign In</a>
       </div>
    </header>
    <main>
    <div>
          <div className="row center">
          {
            data.products.map(product => (
              <Product key={product._id} products={product}></Product> /*we r extracting a modular code*/
            ))
          }

            </div>
          </div>
    </main>
    <footer className="row center">
          All rights reserved.
    </footer>
</div>
  );
}

export default App;
